IF OBJECT_ID('dbo.UniversityScores', 'U') IS NULL
CREATE TABLE dbo.UniversityScores (
    [name] NVARCHAR(MAX),
    [scores_teaching] FLOAT,
    [scores_research] FLOAT,
    [scores_citations] FLOAT,
    [scores_industry_income] FLOAT,
    [scores_international_outlook] FLOAT,
    [record_type] NVARCHAR(MAX),
    [member_level] INT,
    [location] NVARCHAR(MAX),
    [stats_number_students] INT,
    [stats_student_staff_ratio] FLOAT,
    [stats_pc_intl_students] FLOAT,
    [stats_female_male_ratio] FLOAT,
    [subjects_offered] NVARCHAR(MAX),
    [closed] NVARCHAR(MAX),
    [unaccredited] NVARCHAR(MAX),
    [overall_score] NVARCHAR(MAX)
);
